const Log = (props) => {
    return (
        <section className="log">
            <section className="log-title-bar">
                <h2>My Log</h2>
            </section>
            <style jsx>{`
                .log .log-title-bar {
                    border-bottom: 1px solid white;
                }
            `}</style>
        </section>
    )
};

export default Log;
